import React from 'react';

import Pallet from "./Pallet";

const history = (props) => {

    const index = props.colors.findIndex(color => color === props.currentColor);
    console.log(index);

    return <Pallet 
                title="History"
                colors={props.colors} 
                colorClicked={props.colorClicked}/>
};

export default history;
